                    Player player = new Player(playerToolBar.getSelectedPlayerNumber(), playerEvent);
                    Sequence sequence = model.getActualSequence();
                    sequence.addPlayer(player);
                    tableHandballModel.fireTableDataChanged();
                    field.repaint();
                }
            }
        }
